import React from "react";
import "./paginado.css"

export default function Paginado ({recipesxPage,recipes,paginado}){
    const pageNumbers= []

    for(let i=0; i<Math.ceil(recipes/recipesxPage);i++){
        pageNumbers.push(i+1)
    }

    return(
        <nav >
            <ul className="paginado">
                {pageNumbers && pageNumbers.map(n =>(
                   <li key={n} >
                    <button onClick={()=>paginado(n)}>{n} className="numeros"</button>
                   </li> 
                ))}
            </ul>
        </nav>
    )
}
